import React from "react";
import Button from "../Button";
import HeaderText from "../HeaderText";
import Bag from "../../SourceFiles/WhatWeDo/handbag.png";

function WhatWeDo() {
  return (
    <section id="what-we-do">
      <div id="what-we-do-container" className="container">
        <HeaderText
          name="What We Do?"
          text="         Lorem ipsum dolor sit amet. Proin gravida nibh vel velit auctor
            aliquet"
        />
        <div id="wwd-group-flex" className="flex">
          <div className="wwd-group-item">
            <div className="wwd-group-item-img" className = 'flex'>
              <img src={Bag} />
            </div>
            <HeaderText
              name="Lorem"
              text="Lorem ipsum dolor sit amet. Proin gravida nibh vel velit auctor
            aliquet"
            />
            <Button name="Learn More" />
          </div>
        </div>
      </div>
    </section>
  );
}

export default WhatWeDo;
